INSERT INTO `tag_description` VALUES ('/m/0133rf','The Turner Prize, named after the painter J. M. W. Turner, is an annual prize presented to a British visual artist under the age of 50. Awarding the prize is organised by the Tate gallery and staged at Tate Britain. Since its beginnings in 1984 it has become the United Kingdom\'s most publicised art award. Although it represents all media, painters have also won the prize.\nAs of 2004, the monetary award was established at £40,000. There have been different sponsors, including Channel 4 television and Gordon\'s Gin. The prize has been awarded by various distinguished celebrities: in 2006 this was Yoko Ono, and in 2012 the award was presented by Jude Law.\nIt is a controversial event, mainly for the exhibits, such as \"The Physical Impossibility of Death in the Mind of Someone Living\", a shark in formaldehyde by Damien Hirst and \"My Bed\", a dishevelled bed by Tracey Emin. Controversy has also come from other directions, including a Culture Minister criticising exhibits, a guest of honour swearing, a prize judge writing in the press, and a speech by Sir Nicholas Serota.'),('/m/014wxs','The Young British Artists, or YBAs — also referred to as Brit artists and Britart — is the name given to a loose group of visual artists who first began to exhibit together in London, in 1988. Many of the artists graduated from the BA Fine Art course at Goldsmiths, in the late 1980s.\nThe scene began around a series of artist-led exhibitions held in warehouses and factories, beginning in 1988 with the Damien Hirst-led Freeze and, in 1990, East Country Yard Show and Modern Medicine.\nThey are noted for \"shock tactics\", use of throwaway materials, wild-living, and an attitude \"both oppositional and entrepreneurial.\" They achieved considerable media coverage and dominated British art during the 1990s—international survey shows in the mid-1990s included Brilliant! and Sensation.\nMany of the artists were initially supported and collected by Charles Saatchi. Leading artists of the group include Damien Hirst and Tracey Emin. Key works include Hirst\'s The Physical Impossibility of Death in the Mind of Someone Living, a shark preserved in formaldehyde in a vitrine, and Emin\'s My Bed, a dishevelled double bed surrounded by detritus.'),('/m/015g1w','The Royal Academy of Arts is an art institution based in Burlington House on Piccadilly in London. It has a unique position as an independent, privately funded institution led by eminent artists and architects; its purpose is to promote the creation, enjoyment and appreciation of the visual arts through exhibitions, education and debate.'),('/m/015sxw','Tracey Emin, CBE, RA is a Cypriot English artist. She is part of the group known as Britartists or YBAs.\nIn 1997, her work Everyone I Have Ever Slept With 1963–1995, a tent appliquéd with names, was shown at Charles Saatchi\'s Sensation exhibition held at the Royal Academy in London. The same year, she gained considerable media exposure when she appeared drunk and swearing on a live Channel 4 TV discussion.\nIn 1999, Emin had her first solo exhibition in the United States at Lehmann Maupin Gallery, entitled \"Every Part of Me\'s Bleeding\". Later that year, she was a Turner Prize nominee and exhibited My Bed — an installation, consisting of her own unmade dirty bed with used condoms and blood-stained underwear.\nIn 2004, her tent artwork was destroyed in the Momart warehouse fire. In March 2007 Emin was chosen to join the Royal Academy of Arts in London as a Royal Academician. She represented Britain at the 2007 Venice Biennale. Her first major retrospective 20 Years was held in Edinburgh 2008, and toured Europe until 2009.\nIn May 2011, Emin\'s largest major solo exhibition in a public space was held at Hayward Gallery, London titled Love Is What You Want.'),('/m/015wy_','Goldsmiths, University of London, is a public research university and a constituent college of the federal University of London which specialises in the arts, designs, humanities, and social sciences. It was founded in 1891 as Goldsmiths\' Technical and Recreative Institute by the Worshipful Company of Goldsmiths in New Cross, London. It was acquired by the University of London in 1904 and was renamed Goldsmiths\' College. The word College was dropped from its branding in 2006, but \"Goldsmiths\' College\", with the apostrophe, remains the institution\'s formal legal name.\nThe university has a distinguished history of contributing to arts and social sciences. Its Department of Art is widely recognised as one of Britain\'s most prestigious, producing the YBA\'s art collective and over 20 Turner Prize nominees. Goldsmiths is also famous for design, psychology, drama, sociology, music, media and cultural studies, languages and literature, visual cultures, anthropology and educational studies.\nNearly 20% of students come from countries outside the UK, and 52% of all undergraduates are mature students. Around a third of students at Goldsmiths are postgraduate students.'),('/m/018dlc','Sir Edward Coley Burne-Jones, 1st Baronet ARA was a British artist and designer closely associated with the later phase of the Pre-Raphaelite movement, who worked closely with William Morris on a wide range of decorative arts as a founding partner in Morris, Marshall, Faulkner, and Company. Burne-Jones was closely involved in the rejuvenation of the tradition of stained glass art in Britain; his stained glass works include the windows of St. Philip\'s Cathedral, Birmingham, St Martin in the Bull Ring, Birmingham, Holy Trinity Church, Sloane Square, Chelsea, St Martin\'s Church in Brampton, Cumbria, St Michael\'s Church, Brighton, All Saints, Jesus Lane, Cambridge, Christ Church, Oxford and in St. Anne\'s Church, Brown Edge, Staffordshire Moorlands. Burne-Jones\'s early paintings show the heavy inspiration of Dante Gabriel Rossetti, but by the 1860s Burne-Jones was discovering his own artistic \"voice\". In 1877, he was persuaded to show eight oil paintings at the Grosvenor Gallery. These included The Beguiling of Merlin. The timing was right, and he was taken up as a herald and star of the new Aesthetic Movement.'),('/m/01l4hs','Elizabeth Eleanor Siddal was an English artists\' model, poet and artist. She was painted and drawn extensively by artists of the Pre-Raphaelite Brotherhood, including Walter Deverell, William Holman Hunt, John Everett Millais and her spouse, Dante Gabriel Rossetti. She featured prominently in Rossetti\'s early paintings of women.'),('/m/01qwfk','Damien Steven Hirst is an English artist, entrepreneur and art collector. He is the most prominent member of the group known as the Young British Artists, who dominated the art scene in the UK during the 1990s. He is internationally renowned, and is reportedly the United Kingdom\'s richest living artist, with his wealth valued at £215m in the 2010 Sunday Times Rich List. During the 1990s his career was closely linked with the collector Charles Saatchi, but increasing frictions came to a head in 2003 and the relationship ended.\nDeath is a central theme in Hirst\'s works. He became famous for a series of artworks in which dead animals are preserved—sometimes having been dissected—in formaldehyde. The best known of these being The Physical Impossibility of Death in the Mind of Someone Living, a 14-foot tiger shark immersed in formaldehyde in a vitrine. He has also made \"spin paintings,\" created on a spinning circular surface, and \"spot paintings\", which are rows of randomly coloured circles created by his assistants.'),('/m/01_d4','Chicago is the third most populous city in the United States, after New York City and Los Angeles. With 2.7 million residents, it is the most populous city in both the U.S. state of Illinois and the American Midwest. Its metropolitan area, sometimes called Chicagoland, is home to 9.5 million people and is the third-largest in the United States. Chicago is the seat of Cook County.\nChicago was incorporated as a city in 1837, near a portage between the Great Lakes and the Mississippi River watershed, and experienced rapid growth in the mid-nineteenth century. Today, the city is an international hub for finance, commerce, industry, technology, telecommunications, and transportation, with O\'Hare International Airport being the second-busiest airport in the world; it also has the largest number of U.S. highways, and railroad freight entering its region. In 2012, Chicago was listed as an alpha global city by the Globalization and World Cities Research Network, and ranks seventh in the world in the 2014 Global Cities Index.'),('/m/022840','American Indian Wars is the name used in the United States to describe the multiple conflicts between American settlers or the federal government and the native peoples of North America from the time of earliest colonial settlement until approximately 1890. In some cases, wars resulted from conflicts and competition for resources between the European colonists and Native Americans. There was population pressure as settlers expanded their territory, generally pushing indigenous people northward and westward. But, warfare and raiding also took place as a result of wars between European powers; in North America, they enlisted their Native American allies to help them conduct warfare against each other\'s settlements.\nMany conflicts were local, involving disputes over land use, and some entailed cycles of reprisal. Particularly in later years, conflicts were spurred by ideologies such as Manifest Destiny, which held that the United States was destined to expand from coast to coast on the North American continent.'),('/m/025ycb5','The Shadow of Death is a religious painting by William Holman Hunt, on which he worked from 1870 to 1873, during his second trip to the Holy Land. It depicts Jesus as a young man prior to his ministry, working as a carpenter. He is shown stretching his arms after sawing wood. The shadow of his outstretched arms falls on a wooden spar on which carpentry tools hang, creating a \"shadow of death\" prefiguring the crucifixion. His mother Mary is depicted from behind, gazing up at the shadow, having been looking into a box in which she has kept the gifts given by the Magi.\nIn 1850 Hunt\'s colleague John Everett Millais had already portrayed Jesus as a budding carpenter, helping his father as a young boy. Millais\' painting, Christ in the House of his Parents, had been viciously attacked by critics because of the alleged squalour of the workshop. Hunt repeats many features of Millais\'s painting, but emphasises Jesus\' physical health and muscularity.\nHunt\'s portrayal of Jesus as a hard-working adult craftsman and labourer was also probably influenced by Thomas Carlyle who repeatedly emphasised the spiritual value of honest labour. It also corresponds to the emergence of Muscular Christianity, the view of writers Charles Kingsley, Thomas Hughes and others, who promoted physical strength and health as well as a vigorous pursuit of Christian ideals in personal and political life. Carlyle had strongly criticised Hunt\'s earlier depiction of Jesus in The Light of the World, identifying it as a \"papistical\" picture because it showed Jesus in regal clothing. The portrayal of Mary\'s thriftiness also fits the emphasis on working class financial responsibility promoted by contemporary evangelical publications such as The British Workman.'),('/m/025ylkw','St. Michael Vanquishing Satan is a painting by the Italian High Renaissance painter Raphael.\nIt is a large-scale and mature version of a subject he had earlier treated in the youthful miniature of St. Michael. Both works are located in the Louvre in Paris, France.'),('/m/025yzqx','The Baronci Altarpiece was a painting by the Italian High Renaissance artist Raphael. His first recorded commission, it was made for Andrea Baronci\'s chapel in the church of Sant\'Agostino in Città di Castello, near Urbino. The altarpiece was seriously damaged during an earthquake in 1789, and since 1849 fragments of the original painting have been part of different collections.'),('/m/025z19v','The Mond Crucifixion is a painting by the Italian renaissance artist Raphael.\nAn early work influenced by Perugino, it was originally an altarpiece in the church of San Domenico in Città di Castello, near Raphael\'s hometown of Urbino. The painting shows Jesus on the cross, who is looking peaceful even though he is dying. There are two angels catching his blood in chalices. On Jesus\' left kneels Mary Magdalene, with John the Evangelist standing behind her. On his right Mary stands, and St. Jerome, to whom the altar was dedicated, is kneeling. At the foot of the cross is the inscription RAPHAEL/ VRBIN / AS /.P.[INXIT] in silver letters.\nThe painting was bequeathed to the National Gallery by Ludwig Mond.\nThe sun and moon at the top are present despite the Council of Constantinople prohibition of such symbology for its reference to other religions.'),('/m/025_ccf','The Vision of the Cross is a painting made between 1520 and 1524 by assistants of the Italian renaissance artist Raphael. After the master\'s death in 1520, Gianfrancesco Penni, Giulio Romano and Raffaellino del Colle from Raphael\'s workshop worked together to finish the commission to decorate with frescoes the rooms that are now known as the Stanze di Raffaello, in the Apostolic Palace in the Vatican.\nThe Vision of the Cross is located in the Sala di Costantino. In the painting, emperor Constantine I is seen just before the Battle of the Milvian Bridge on October 28, 312. According to legend, a cross appeared to Constantine in the sky, after which as seen in the fresco and following Eusebius of Caesarea Vita Constantini, he adopted the Greek motto \"Εν τούτῳ νίκα\", i.e. \"By this, conquer\", a motto that has been rendered in Latin as \"In hoc signo vinces\", i.e. \"In this sign you shall conquer\".\nThis Mannerist painting is a crowded and confused melee and melange of images, including a dragon, a dwarf, two popes, and various symbols. Proportions among the soldiers appear confused, with some dwarfed by more distant figures.'),('/m/0260bj0','The Mass at Bolsena is a painting by the Italian renaissance artist Raphael. It was painted between 1512 and 1514 as part of Raphael\'s commission to decorate with frescoes the rooms that are now known as the Raphael Rooms, in the Apostolic Palace in the Vatican. It is located in the Stanza di Eliodoro, which is named after The Expulsion of Heliodorus from the Temple.\nThe Mass at Bolsena shows an incident that is said to have taken place in 1263. A Bohemian priest who doubted the doctrine of transubstantiation, celebrated mass at Bolsena, where the bread of the eucharist began to bleed. The following year, in 1264, Pope Urban IV instituted the Feast of Corpus Christi to celebrate this miraculous event. Bolsena is north of Rome and the priest who doubted was a German. He was taking mass and when he doubted the Transubstantiation, blood spouted from the host and fell onto the tablecloth in the shape of a cross and he was reconverted.\nPresent in this painting is a self-portrait of the artist, Raphael, as one of the Swiss Guard in the lower right of the fresco, facing out with bound-up hair. This is one of several instances in which Raphael has placed himself in his paintings.'),('/m/0260xqn','The Battle of Ostia is a painting by the workshop of the Italian renaissance artist Raphael. The painting was part of Raphael\'s commission to decorate the rooms that are now known as the Stanze di Raffaello, in the Apostolic Palace in the Vatican. It is located in the room that was named after The Fire in the Borgo, the Stanza dell\'incendio del Borgo and was inspired by the naval battle fought in 849 between the Saracens and a Christian League of Papal, Neapolitan and Gaetan ships. In the painting Pope Leo IV, with the features of Pope Leo X, is giving thanks after the Arab ships were destroyed by a storm.'),('/m/02618mv','The Oath of Leo III is a painting by the workshop of the Italian renaissance artist Raphael. The painting was part of Raphael\'s commission to decorate the rooms that are now known as the Stanze di Raffaello, in the Apostolic Palace in the Vatican. It is located in the room that was named after The Fire in the Borgo, the Stanza dell\'incendio del Borgo. In the fresco, Pope Leo III is seen during the trial on December 23 AD 800 during which he was brought face to face with the nephews of his predecessor Pope Hadrian I, who had accused him of misconduct. The assembled bishops declared that they could not judge the pope, after which Leo took an oath of purgation of his own free will.'),('/m/02624w6','The Sybils, or Sybils receiving instruction from Angels, is a painting by the Italian renaissance artist Raphael. It was painted in 1514, as part of a commission Raphael had received from the papal banker Agostino Chigi to decorate the interior of Santa Maria della Pace in Rome.'),('/m/0263z02','Saint Catherine of Alexandria is a painting by the Italian Renaissance artist Raphael. In the painting, Catherine of Alexandria is looking upward in ecstasy and leaning on a wheel - an allusion to the breaking wheel of her martyrdom.\nIt was painted circa 1507, shortly after Raphael\'s arrival in Florence and shows the young artist in a transitional phase. The depiction of religious passion in the painting is still reminiscent of Pietro Perugino. But the graceful contrapposto of Catherine\'s pose is typical of the influence of Leonardo da Vinci on Raphael, and is believed to be an echo of Leonardo\'s lost painting Leda and the Swan.\nThis picture was partially used on the cover of The Smashing Pumpkins album Mellon Collie and the Infinite Sadness.'),('/m/026zf3n','St. George or St. George and the Dragon is a small painting by the Italian Renaissance artist Raphael. It is housed in the Louvre in Paris. A later version of the same subject is the St. George in the National Gallery of Art in Washington, D.C.'),('/m/027ghtv','The Story of the Glittering Plain is an 1891 fantasy novel by William Morris, perhaps the first modern fantasy writer to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature. It is also important for its exploration of the socialist themes that interested Morris.\nHis earlier fantasies The House of the Wolfings and The Roots of the Mountains were to some degree historical novels. Like these The Story of the Glittering Plain is set in a world similar to the distant past of northern Europe. Morris would go on to develop the new genre established in this work in such later fantasies as Child Christopher and Goldilind the Fair, The Wood Beyond the World, The Well at the World\'s End, and The Water of the Wondrous Isles.'),('/m/0282bhv','State Britain is an installation artwork by Mark Wallinger displayed in Tate Britain in January 2007. It is a recreation from scratch of a protest display about the treatment of Iraq, set up by Brian Haw outside Parliament and eventually confiscated by the police. Haw\'s display contained several hundred items donated by members of the public. As well as continuing the protest, Wallinger\'s recreation in a different context also brings up questions of authenticity. Wallinger won the Turner Prize in 2007 for this piece.'),('/m/02cft','Dublin is the capital of Ireland. Dublin is in the province of Leinster on Ireland\'s east coast, at the mouth of the River Liffey.\nFounded as a Viking settlement, the Kingdom of Dublin became Ireland\'s principal city following the Norman invasion. The city expanded rapidly from the 17th century and was briefly the second largest city in the British Empire before the Act of Union in 1800. Following the partition of Ireland in 1922, Dublin became the capital of the Irish Free State and later the Republic of Ireland.\nDublin is administered by a City Council. The city is listed by the Globalization and World Cities Research Network as a global city, with a ranking of \"Alpha-\", placing it among the top thirty cities in the world. It is a historical and contemporary centre for education, the arts, administration, economy and industry.'),('/m/02pngf2','The Physical Impossibility of Death in the Mind of Someone Living is an artwork created in 1991 by Damien Hirst, an English artist and a leading member of the \"Young British Artists\". It consists of a tiger shark preserved in formaldehyde in a vitrine. It was originally commissioned in 1991 by Charles Saatchi, who sold it in 2004, to Steven A. Cohen for an undisclosed amount, widely reported to have been $8 million. However, the title of Don Thompson\'s book, The $12 Million Stuffed Shark: The Curious Economics of Contemporary Art, suggests a higher figure.\nOwing to deterioration of the original 14-foot tiger shark, it was replaced with a new specimen in 2006. It was on loan to the Metropolitan Museum of Art in New York City from 2007 to 2010.\nIt is considered the iconic work of British art in the 1990s, and has become a symbol of Britart worldwide.'),('/m/02q9k_q','The Scapegoat is a painting by William Holman Hunt which depicts the \"scapegoat\" described in the Book of Leviticus. On the Day of Atonement, a goat would have its horns wrapped with a red cloth – representing the sins of the community – and be driven off.\nHe started painting on the shore of the Dead Sea, and continued in his studio in London. The work exists in two versions, a small version in brighter colours with a dark-haired goat and a rainbow, held by Manchester Art Gallery, and a larger version in more muted tones with a light-haired goat held by the Lady Lever Art Gallery in Port Sunlight.'),('/m/02q9m89','The Meeting of Leo I and Attila is a fresco by the Italian Renaissance artist Raphael and his assistant Giulio Romano. It was painted in 1514 as part of Raphael\'s commission to decorate the rooms that are now known as the Stanze di Raffaello, in the Apostolic Palace in the Vatican. It is located in the Stanza di Eliodoro, which is named after The Expulsion of Heliodorus from the Temple.\nThe painting depicts the meeting between the Pope Leo I and Attila the Hun, and includes the images of Saint Peter and Saint Paul in the sky bearing swords. Initially, Raphael depicted Leo I with the face of Pope Julius II but after Julius\' death, Raphael changed the painting to resemble the new pope, Leo X.'),('/m/02qd8fd','The Miracle of the Holy Fire is a painting by William Holman Hunt which depicts the Greek Orthodox rite of the Holy Fire in the Church of the Holy Sepulchre Jerusalem. Hunt believed the fire to be a pious fraud which brought Christianity into disrepute. He intended the painting to be a satire in the manner of William Hogarth. Hunt published an elaborate keyplate explaining the identity of the various characters depicted.'),('/m/02qdrky','A Vision of Fiammetta is an oil painting in the Pre-Raphaelite which was created by Dante Gabriel Rossetti in 1878. The painting was one half of one of Rossetti\'s \"double works\", accompanying his Ballads and Sonnets. Maria Spartali Stillman modelled for the painting. The subject of painting is Boccacio\'s muse named Fiammetta.'),('/m/02qq7d4','The Finding of the Saviour in the Temple is a painting by William Holman Hunt intended as an ethnographically accurate version of the subject traditionally known as \"Christ Among the Doctors\", an illustration of the child Jesus debating the interpretation of the scripture with learned rabbis. The passage illustrated is from the Gospel of Luke, 2:41, which states:\nEvery year his parents went to Jerusalem for the Feast of the Passover. When he was twelve years old, they went up to the Feast, according to the custom. After the Feast was over, while his parents were returning home, the boy Jesus stayed behind in Jerusalem, but they were unaware of it. Thinking he was in their company, they traveled on for a day. Then they began looking for him among their relatives and friends. When they did not find him, they went back to Jerusalem to look for him. After three days they found him in the temple courts, sitting among the teachers, listening to them and asking them questions. Everyone who heard him was amazed at his understanding and his answers. When his parents saw him, they were astonished. His mother said to him, \"Son, why have you treated us like this? Your father and I have been anxiously searching for you.\" \"Why were you searching for me?\" he asked. \"Didn\'t you know I had to be in my Father\'s house?\" But they did not understand what he was saying to them.'),('/m/02r974w','The Wood Beyond the World is a fantasy novel by William Morris, perhaps the first modern fantasy writer to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature.\nIt was first published in hardcover by Morris\'s Kelmscott Press in 1894. Its importance in the history of fantasy literature was recognized by its republication by Ballantine Books as the third volume of the celebrated Ballantine Adult Fantasy series in July, 1969. The Ballantine edition includes an introduction by Lin Carter.'),('/m/02r975k','The Water of the Wondrous Isles is a fantasy novel by William Morris, perhaps the first writer of modern fantasy to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature. It was first printed in 1897 by Morris\' own Kelmscott Press on vellum and artisanal paper in a blackletter type of his own design. For the wider reading public, a hardcover trade edition was published later that year by Longmans, Green and Co. The novel\'s importance in the history of fantasy literature was recognized by its republication by Ballantine Books as the thirty-eighth volume of the celebrated Ballantine Adult Fantasy series in November, 1971. The Ballantine edition includes an introduction by Lin Carter.\nMorris considered his fantasies a revival of the medieval tradition of chivalrous romances; in consequence, they tend to have sprawling plots of strung-together adventures. These prose romances were written in a mock-Medieval style which some modern readers may find onerous.'),('/m/02r9767','The Sundering Flood is a fantasy novel by William Morris, perhaps the first modern fantasy writer to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature. The Sundering Flood was Morris\' last work of fiction, completed only in rough draft, with the ending dictated from his deathbed. It was edited by his daughter May into finished form for publication.\nMorris considered his fantasies a revival of the medieval tradition of chivalrous romances; consequently, they tend to have sprawling plots of strung-together adventures. His use of archaic language has been seen as difficult by some modern readers.'),('/m/02rcj1p','This sortable table is intended to list railway accidents in the Republic of Ireland, and before its formation accidents in the provinces of Leinster, Munster and Connacht, plus the counties of Donegal, Cavan and Monaghan. It is currently limited to accidents where at least one train occupant was killed. It does not include acts of terror, nor accidents in Northern Ireland.'),('/m/02rft35','Isabella and the Pot of Basil is a painting completed in 1868 by William Holman Hunt depicting a scene from John Keats\'s poem Isabella, or the Pot of Basil. It depicts the heroine Isabella caressing the basil pot in which she had buried the severed head of her murdered lover Lorenzo.\nHunt had drawn an illustration to the poem in 1848, shortly after the foundation of the Pre-Raphaelite Brotherhood, but he had not developed it into a completed painting. The drawing portrayed a very different scene, depicting Lorenzo as a clerk at work while Isabella\'s brothers study their accounts and order around underlings.\nHunt returned to the poem in 1866, shortly after his marriage, when he began to paint several erotically charged subjects. His sensuous painting Il Dolce Far Niente had sold quickly, and he conceived the idea for a new work depicting Isabella. Having travelled with his pregnant wife Fanny to Italy, Hunt began work on the painting. However, after giving birth, Fanny died from fever in December 1866. Hunt turned the painting into a memorial to his wife, using her features for Isabella.'),('/m/02rh97y','For the Love of God is a sculpture by artist Damien Hirst produced in 2007. It consists of a platinum cast of an 18th-century human skull encrusted with 8,601 flawless diamonds, including a pear-shaped pink diamond located in the forehead that is known as the Skull Star Diamond. The skull\'s teeth are original, and were purchased by Hirst in London. The artwork is a Memento mori, or reminder of the mortality of the viewer. In 2007, art historian Rudi Fuchs, observed: \'The skull is out of this world, celestial almost. It proclaims victory over decay. At the same time it represents death as something infinitely more relentless. Compared to the tearful sadness of a vanitas scene, the diamond skull is glory itself.\' Costing £14 million to produce, the work was placed on its inaugural display at the White Cube gallery in London in an exhibition Beyond belief with an asking price of £50 million. This would have been the highest price ever paid for a single work by a living artist. According to Art Knowledge News, a sale was being completed at the $100 million asking price.[citation needed]'),('/m/02rhv7r','The Portrait of Smeralda Brandini is a tempera on panel painting by the Italian Renaissance artist Sandro Botticelli of about 1475, in the Victoria and Albert Museum, London.'),('/m/02rhv9t','The Madonna and Child with Three Angels is a painting by the Italian Renaissance master Sandro Botticelli, executed in 1493. It is housed in the Pinacoteca Ambrosiana of Milan.\nThe Virgin Mary is portrayed while giving her breast to the Child, the latter being supported by an angel. The Italian name derives from the rich baldachin over the scene.'),('/m/02rvfmp','Everyone I Have Ever Slept With 1963–1995, also known as \"The Tent\", was an artwork created by Tracey Emin RA, an English artist and a leading member of the group known as Britartists or YBAs. The work was a tent with the appliquéd names of, literally, everyone she had ever slept with, but not necessarily in the sexual sense. It achieved iconic status, was owned by Charles Saatchi, and was destroyed in the 2004 Momart London warehouse fire. She has refused to recreate it.'),('/m/02ry5h1','The Madonna and Child with Six Saints, also known as Sant\'Ambrogio Altarpiece, is a painting by the Italian Renaissance master Sandro Botticelli, finished around 1470. It is housed in the Galleria degli Uffizi, in Florence.\nIt portrays the Virgin enthroned with the saints Mary Magdalene, John the Baptist, Francis, Catherine of Alexandria and, kneeling, Cosmas and Damian. It is in fact most likely that the latter are portraits of Medici members. Lorenzo il Magnifico and his brother Giuliano have been considered.'),('/m/02t1t','The Easter Rising, also known as the Easter Rebellion, was an armed insurrection staged in Ireland during Easter Week, 1916. The Rising was mounted by Irish republicans with the aims of ending British rule in Ireland, seceding from the United Kingdom of Great Britain and Ireland, and establishing an independent Irish Republic at a time when the United Kingdom was heavily engaged in World War I. It was the most significant uprising in Ireland since the rebellion of 1798.\nOrganised by seven members of the Military Council of the Irish Republican Brotherhood, the Rising began on Easter Monday, 24 April 1916, and lasted for six days. Members of the Irish Volunteers — led by schoolmaster and Irish language activist Patrick Pearse, joined by the smaller Irish Citizen Army of James Connolly, along with 200 members of Cumann na mBan — seized key locations in Dublin and proclaimed the Irish Republic independent of the United Kingdom. There were some actions in other parts of Ireland: however, except for the attack on the Royal Irish Constabulary barracks at Ashbourne, County Meath, they were minor.'),('/m/03c1v5x','A Tale of the House of the Wolfings and All the Kindreds of the Mark is a fantasy novel by William Morris, perhaps the first modern fantasy writer to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature. It was first published in hardcover by Reeves and Turner in 1889. Its importance in the history of fantasy literature was recognized by its republication by the Newcastle Publishing Company as the sixteenth volume of the celebrated Newcastle Forgotten Fantasy Library in April, 1978.\nThis book also influenced J. R. R. Tolkien\'s popular The Lord of the Rings. In a December 31, 1960 letter published in The Letters of J. R. R. Tolkien, Tolkien wrote: \'The Dead Marshes and the approaches to the Morannon owe something to Northern France after the Battle of the Somme. They owe more to William Morris and his Huns and Romans, as in The House of the Wolfings or The Roots of the Mountains.\" Among the numerous parallels with The Lord of the Rings, Morris has Old English-style placenames such as Mirkwood, germanic personal names such as Thiodolf, and dwarves as skilled smiths.'),('/m/03c2sfs','Child Christopher and Goldilind the Fair is a fantasy novel by William Morris, perhaps the first modern fantasy writer to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature. It was first published in hardcover by Morris\' Kelmscott Press in 1895. Its importance in the history of fantasy literature was recognized by its republication by the Newcastle Publishing Company as the twelfth volume of the celebrated Newcastle Forgotten Fantasy Library in April, 1977.'),('/m/03cch4g','A Dream of John Ball is a novel by English author William Morris about the English peasants\' revolt of 1381. It features the rebel priest John Ball, who appeared to be advocating a socialistic philosophy in advance of his time. John Ball is famed for his question \"When Adam delved and Eve span, who was then the gentleman?\"'),('/m/03cy_37','The Madonna della Loggia is a painting attributed to the Italian Renaissance artist Sandro Botticelli, dating to c. 1467. A tempera on panel work, it is located in the Uffizi, Florence, Italy.'),('/m/03mdtvg','Beata Beatrix is an oil on canvas painting by Pre-Raphaelite artist Dante Gabriel Rossetti, completed in 1870. It depicts Beatrice Portinari from Dante Alighieri\'s poem La Vita Nuova at the moment of her death. The painting\'s title in English translates to \'Blessed Beatrice\'. La Vita Nuova had been a story that Rossetti had found of interest from childhood and he had begun work translating it into English in 1845 and published it in his work, The Early Italian Poets.\nRossetti modeled Beatrice after his deceased wife and frequent model, Elizabeth Siddal, who died in 1862. The painting was created from the numerous drawings that Rossetti had made of Siddal during their time together. The symbolism in the painting of a red dove, a messenger of love, relates back to Rossetti\'s love for Siddal with the white poppy representing laudanum and the means of her death. Several of Siddal\'s friends found the painting to bear little resemblance to the drawings of her—the facial features were harder and the neck is out of proportion. Beata Beatrix is one of Rossetti\'s most recognized works and has made Siddal\'s name to be one that is frequently linked with Dante Alighieri\'s Beatrice.\nIn an 1873 letter to his friend William Morris, Rossetti said he intended the painting \"not as a representation of the incident of the death of Beatrice, but as an ideal of the subject, symbolized by a trance or sudden spiritual transfiguration.\"'),('/m/03nxm6j','The Resurrection of Christ, also called The Kinnaird Resurrection, is an oil painting on wood by the Italian High Renaissance master Raphael. The work is one the earliest known paintings by the artist, executed between 1499 and 1502. It is probably a piece of an unknown predella, though it has been suggested that the painting could be one of the remaining works of the Baronci altarpiece, Raphael\'s first recorded commission. The painting is housed in the São Paulo Museum of Art.\nThe Kinnaird Resurrection is one of the first preserved works of Raphael in which his natural dramatic style of composition was already obvious, as opposed to the gentle poetic style of his master, Pietro Perugino. The extremely rational composition is ruled by a complex ideal geometry which interlinks all the elements of the scene and gives it a strange animated rhythm, transforming the characters in the painting into co-protagonists in a unique \"choreography\". The painting possesses an esthetic influence from Pinturicchio and Melozzo da Forlì, though the spatial orchestration of the work, with its tendency to movement, shows Raphael\'s knowledge of the Florentine artistic milieu of the 16th century.'),('/m/03qhzsc','The Madonna Colonna is a painting by the Italian Renaissance artist Raphael. It was painted in 1508, near the end of Raphael\'s Florentine period.'),('/m/03xpqgs','Dante Gabriel Rossetti was an English poet, illustrator, painter and translator. He founded the Pre-Raphaelite Brotherhood in 1848 with William Holman Hunt and John Everett Millais, and was later to be the main inspiration for a second generation of artists and writers influenced by the movement, most notably William Morris and Edward Burne-Jones. His work also influenced the European Symbolists and was a major precursor of the Aesthetic movement.\nRossetti\'s art was characterised by its sensuality and its medieval revivalism. His early poetry was influenced by John Keats. His later poetry was characterised by the complex interlinking of thought and feeling, especially in his sonnet sequence The House of Life. Poetry and image are closely entwined in Rossetti\'s work; he frequently wrote sonnets to accompany his pictures, spanning from The Girlhood of Mary Virgin and Astarte Syriaca, while also creating art to illustrate poems such as Goblin Market by the celebrated poet Christina Rossetti, his sister.\nRossetti\'s personal life was closely linked to his work, especially his relationships with his models and muses Elizabeth Siddal, Fanny Cornforth, and Jane Morris.'),('/m/041h0','John Ronald Reuel Tolkien, CBE was an English writer, poet, philologist, and university professor, best known as the author of the classic high fantasy works The Hobbit, The Lord of the Rings, and The Silmarillion.\nHe served as the Rawlinson and Bosworth Professor of Anglo-Saxon and Fellow of Pembroke College, Oxford, from 1925 to 1945 and Merton Professor of English Language and Literature and Fellow of Merton College, Oxford from 1945 to 1959. He was at one time a close friend of C. S. Lewis—they were both members of the informal literary discussion group known as the Inklings. Tolkien was appointed a Commander of the Order of the British Empire by Queen Elizabeth II on 28 March 1972.\nAfter Tolkien\'s death, his son Christopher published a series of works based on his father\'s extensive notes and unpublished manuscripts, including The Silmarillion. These, together with The Hobbit and The Lord of the Rings form a connected body of tales, poems, fictional histories, invented languages, and literary essays about a fantasy world called Arda, and Middle-earth within it. Between 1951 and 1955, Tolkien applied the term legendarium to the larger part of these writings.'),('/m/04b0cm','News from Nowhere is a classic work combining utopian socialism and soft science fiction written by the artist, designer and socialist pioneer William Morris. In the book, the narrator, William Guest, falls asleep after returning from a meeting of the Socialist League and awakes to find himself in a future society based on common ownership and democratic control of the means of production. In this society there is no private property, no big cities, no authority, no monetary system, no divorce, no courts, no prisons, and no class systems. This agrarian society functions simply because the people find pleasure in nature, and therefore they find pleasure in their work.\nThe book explores a number of aspects of this society, including its organisation and the relationships which it engenders between people. Morris cleverly fuses Marxism and the romance tradition when he presents himself as an enchanted figure in a time and place different from Victorian England. As Morris, the romance character, quests for love and fellowship—and through them for a reborn self—he encounters romance archetypes in Marxist guises. Old Hammond is both the communist educator who teaches Morris the new world and the wise old man of romance. Dick and Clara are good comrades and the married lovers who aid Morris in his wanderings. The journey on the Thames is both a voyage through society transformed by revolution and a quest for happiness. The goal of the quest, met and found though only transiently, is Ellen, the symbol of the reborn age and the bride the alien cannot win. Ellen herself is a multidimensional figure; a working class woman emancipated under socialism, she is also a benign nature spirit as well as the soul in the form of a woman. The book offers Morris\' answers to a number of frequent objections to socialism, and underlines his belief that socialism will entail not only the abolishment of private property but also of the divisions between art, life, and work.'),('/m/04f44c3','Ann Dancing is an artwork created in 2007 by Julian Opie a Welsh artist and former trustee of the Tate. The sculpture was removed from its base on August 20, 2008, for repairs, and was returned on October 31 of that year.'),('/m/04q94cc','A Converted British Family Sheltering a Christian Missionary from the Persecution of the Druids is a painting by William Holman Hunt that was exhibited at the Royal Academy in 1850, and is now in the Ashmolean Museum in Oxford. It was a companion to John Everett Millais\'s Christ in the House of His Parents. Both artists sought to depict similar episodes from very early Christian history, portraying families helping an injured individual. Both stressed the primitivism of the scene.'),('/m/04vw0j3','\"The Annunciation\" (1879) is a painting by British artist Edward Burne-Jones.'),('/m/04yg5v9','The Awakening Conscience is an oil-on-canvas painting by English artist William Holman Hunt, one of the founders of the Pre-Raphaelite Brotherhood, which depicts a young woman rising from her position in the lap of a man and gazing transfixed out of the window of a room.\nInitially the painting would appear to be one of a momentary disagreement between husband and wife, or brother and sister, but the title and a host of symbols within the painting make it clear that this is a mistress and her lover. The woman\'s clasped hands provide a focal point and the position of her left hand emphasizes the absence of a wedding ring. Around the room are dotted reminders of her \"kept\" status and her wasted life: the cat beneath the table toying with a bird; the clock concealed under glass; a tapestry which hangs unfinished on the piano; the threads which lie unravelled on the floor; the print of Frank Stone\'s Cross Purposes on the wall; Edward Lear\'s musical arrangement of Tennyson\'s poem \"Tears, Idle Tears\" which lies discarded on the floor, and the music on the piano, Thomas Moore\'s \"Oft in the Stilly Night\", the words of which speak of missed opportunities and sad memories of a happier past. The discarded glove and top hat thrown on the table top suggest a hurried assignation. The room is too cluttered and gaudy to be in a Victorian family home; the bright colours, unscuffed carpet, and pristine, highly-polished furniture speak of a room recently furnished for a mistress. Art historian Elizabeth Prettejohn notes that although the interior is now viewed as \"Victorian\" it still exudes the \"\'nouveau-riche\' vulgarity\" that would have made the setting distasteful to contemporary viewers. The painting\'s frame is decorated with further symbols: bells, marigolds, and a star above the girl\'s head. It also bears a verse from the Book of Proverbs: \"As he that taketh away a garment in cold weather, so is he that singeth songs to an heavy heart\".'),('/m/04yh7tr','An Oak Tree is a conceptual work of art created by Michael Craig-Martin in 1973. The piece, described as being an oak tree, is installed in two units - a pristine installation of a glass of water on a glass shelf on metal brackets 253 centimetres above the ground, and a text mounted on the wall. When first exhibited, the text was given as a handout.\nThe text takes the form of a Q&A about the artwork, in which Craig-Martin describes changing \"a glass of water into a full-grown oak tree without altering the accidents of the glass of water,\" and explains that \"the actual oak tree is physically present but in the form of the glass of water.\" Craig-Martin considered \"the work of art in such a way as to reveal its single basic and essential element, belief that is the confident faith of the artist in his capacity to speak and the willing faith of the viewer in accepting what he has to say\".\nThe work makes the same claim as the Roman Catholic doctrine of Transubstantiation and the Real Presence.\nThe original is in the National Gallery of Australia and an artist\'s copy is on loan to the Tate gallery.'),('/m/050_704','Mother and Child, Divided is a 1995 Turner Prize Award winning work by Damien Hirst.'),('/m/0514lzx','Lady Lilith is an oil painting by Dante Gabriel Rossetti first painted in 1866–68 using his mistress Fanny Cornforth as the model, then altered in 1872–73 to show the face of Alexa Wilding. The subject is Lilith, who was, according to ancient Judaic myth, \"the first wife of Adam\" and is associated with the seduction of men and the murder of children. She is shown as a \"powerful and evil temptress\" and as \"an iconic, Amazon-like female with long, flowing hair.\"\nRossetti overpainted Cornforth\'s face, perhaps at the suggestion of his client, shipping magnate Frederick Richards Leyland, who displayed the painting in his drawing room with five other Rossetti \"stunners.\" After Leyland\'s death, the painting was purchased by Samuel Bancroft and Bancroft\'s estate donated it in 1935 to the Delaware Art Museum where it is now displayed.\nThe painting forms a pair with Sibylla Palmifera, painted 1866–70, also with Wilding as the model. Lady Lilith represents the body\'s beauty, according to Rossetti\'s sonnet inscribed on the frame. Sibylla Palmifera represents the soul\'s beauty, according to the Rossetti sonnet on its frame.'),('/m/0514l_2','Proserpine is an oil painting on canvas by English artist and poet Dante Gabriel Rossetti, painted in 1874 and currently housed at Tate Britain.'),('/m/0514l_8','The Beloved is an oil painting on canvas by English artist Dante Gabriel Rossetti, first painted in 1865 and currently housed at Tate Britain.'),('/m/0514l_g','Pia de\' Tolomei is an oil painting on canvas by English artist Dante Gabriel Rossetti, painted around 1868 and currently housed at the Spencer Museum of Art, on the campus of the University of Kansas in Lawrence, Kansas.'),('/m/0514l_n','Joan of Arc (1864) is a painting by British artist Dante Gabriel Rossetti.'),('/m/0514m00','Dante\'s Dream is a painting from 1871 by the English Pre-Raphaelite painter Dante Gabriel Rossetti. It hangs in the Walker Art Gallery, Liverpool, Merseyside, England.\nRossetti had a lifelong interest in the Italian poet Dante Alighieri. The painting was inspired by Dante\'s poem La Vita Nuova. In this poem Dante dreams that he is led to the death-bed of Beatrice Portinari, who was the object of his unfulfilled love. Dante, in black, stands looking towards the dying Beatrice who is lying on a bed. Two female figures in green hold a canopy over her. An angel in red holds Dante\'s hand and leans forward to kiss Beatrice.\nIn the painting, Rossetti creates a visionary world with complex symbols. The symbols include the green clothes of Beatrice\'s attendants, signifying hope; spring flowers in the foreground symbolising purity; and red doves for love.\nIt is Rossetti\'s largest painting. The model for Beatrice was Jane Morris, the wife of William Morris. The Walker Art Gallery bought the painting directly from the artist in 1881 for £1575. In 1897 it was sent to Berlin to be photographed, but was then noted to be \"in a dirty condition\". Again in 1904 the painting was noted to be in \"a bad condition\" and it was considered that its condition had been worsened by its journey to and from Berlin. The painting was sent in 1908 to the National Gallery in London to be relined, that is, for a new canvas to the glued to the original. It was then returned to Liverpool. During the Second World War, it was removed from its stretcher, rolled and stored in the basement of the gallery. In 1941 the painting was moved, together with other large paintings from the gallery, to Ellesmere College in Shropshire. It was noted at this time that it had sustained some damage. Conservation work was carried out on the painting in 1960 and in 1985.'),('/m/0514m06','Ecce Ancilla Domini, or The Annunciation, is an oil painting by the English artist Dante Gabriel Rossetti, first painted in 1850 and now in Tate Britain in London. The Latin title is a quotation from the Vulgate text of the first chapter of the Gospel of Saint Luke, describing the Annunciation, where Mary accepts the message brought to her by the Angel Gabriel that she would give birth to a child by God.'),('/m/055rd2','Michael Craig-Martin, RA is a contemporary conceptual artist and painter. He is noted for his fostering of the Young British Artists, many of whom he taught, and for his conceptual artwork, An Oak Tree. He is Emeritus Professor of Fine Art at Goldsmiths.'),('/m/057vlkc','Portrait of a Young Man or Portrait of a Youth, a portrait attributed to Sandro Botticelli, is an example of Italian Renaissance painting. It was painted in the early 1480s with tempera on panel and is now housed in the National Gallery of Art in Washington, D.C. Features of this piece include his interesting expression and elegant hand gesture, which some have interpreted as an early depiction of juvenile arthritis or Marfan syndrome.'),('/m/059rby','New York is a state in the Northeastern and Mid-Atlantic regions of the United States. New York is the 27th-most extensive, the third-most populous, and the seventh-most densely populated of the 50 United States. New York is bordered by New Jersey and Pennsylvania to the south and by Connecticut, Massachusetts, and Vermont to the east. The state has a maritime border with Rhode Island east of Long Island, as well as an international border with the Canadian provinces of Ontario to the west and north, and Quebec to the north. The state of New York is often referred to as New York State, so as to distinguish it from New York City.\nNew York City, with a Census-estimated population of over 8.4 million in 2013, is the most populous city in the United States. Alone, it makes up over 40 percent of the population of New York State. It is known for its status as a center for finance and culture and for its status as the largest gateway for immigration to the United States. New York City attracts considerably more foreign visitors than any other US city. Both the state and city were named for the 17th century Duke of York, future King James II of England.'),('/m/05c46q','Jane Morris was an English artists\' model who embodied the Pre-Raphaelite ideal of beauty. She was a model and muse to the artists William Morris, whom she married, and Dante Gabriel Rossetti.'),('/m/05qgh2p','Golden Wings and Other Stories is a collection of fantasy short stories by William Morris, first published in trade paperback by the Newcastle Publishing Company in March 1976 as the eighth volume of the celebrated Newcastle Forgotten Fantasy Library. The first hardcover edition was published by Borgo Press in 1980. The stories were originally published in The Oxford and Cambridge Magazine in 1856. More recently the stories have been combined with Morris\'s other contributions to the magazine, including reviews, essays and poems, to form the expanded collection The Hollow Land and Other Contributions to the Oxford and Cambridge Magazine, published by Forgotten Books in June, 2010.\nThe book contains short works of fiction by the author, together with an introduction by Alfred Noyes and an afterword by Richard B. Mathews.'),('/m/05qgkdn','The Roots of the Mountains: Wherein is Told Somewhat of the Lives of the Men of Burgdale, Their Friends, Their Neighbors, Their Foemen, and Their Fellows in Arms is a fantasy novel by William Morris, perhaps the first modern fantasy writer to unite an imaginary world with the element of the supernatural, and thus the precursor of much of present-day fantasy literature. It was first published in hardcover by Reeves and Turner in 1889. Its importance in the history of fantasy literature was recognized by its republication by the Newcastle Publishing Company as the nineteenth volume of the celebrated Newcastle Forgotten Fantasy Library in April, 1979.\nAccording to Graham Seaman, \"The Roots of the Mountains seems to be the story that inspired the subplot of the Dunedain, wanderers of fading heroic past defending the frontiers of the Shire against the Orcs, and the loves of Aragorn, Eowyn, Faramir, and Arwen in Tolkien\'s Lord of the Rings.\"\nThis work and its predecessor, The House of the Wolfings, were to some degree historical novels, with little or no magic. Morris would go on to develop the new genre established in these works in such later fantasies as Child Christopher and Goldilind the Fair, The Wood Beyond the World, The Well at the World\'s End, and The Water of the Wondrous Isles.'),('/m/0669vsy','On Art and Life is a book by John Ruskin.'),('/m/06n3yp2','The Story of Sigurd the Volsung and the Fall of the Niblungs is an epic poem of over 10,000 lines by William Morris that tells the tragic story, drawn from the Volsunga Saga and the Elder Edda, of the Norse hero Sigmund, his son Sigurd and Sigurd\'s wife Gudrun. It sprang from a fascination with the Volsung legend that extended back twenty years to the author\'s youth, and had already resulted in several other literary and scholarly treatments of the story. It was Morris\'s own favourite of his poems, and was enthusiastically praised both by contemporary critics and by such figures as T. E. Lawrence and George Bernard Shaw. In recent years it has been rated very highly by many William Morris scholars, but has never succeeded in finding a wide readership on account of its great length and archaic diction. It has been seen as an influence on such fantasy writers as Andrew Lang and J. R. R. Tolkien. The Story of Sigurd is available in modern reprints, both in its original form and in a cut-down version, but there is no critical edition.'),('/m/070pzwm','The Doom Fulfilled (1888) is a painting by British artist Edward Burne-Jones.'),('/m/070pzwt','The Baleful Head (c. 1886-1887) is a painting by British artist Edward Burne-Jones.'),('/m/070pzx2','The Finding of Medusa (c. 1888-1892) is a painting by British artist Edward Burne-Jones.'),('/m/070pzx8','Perseus and the Graiae (1892) is a painting by British artist Edward Burne-Jones.'),('/m/071lhw1','The Birth of Pegasus and Chrysaor (c. 1876-1885) is a painting by British artist Edward Burne-Jones.'),('/m/071ljl9','Atlas Turned to Stone (1882) is a painting by British artist Edward Burne-Jones.'),('/m/073swq','The King of the Golden River or The Black Brothers: A Legend of Stiria by John Ruskin was originally written in 1841 for the twelve-year-old Effie Gray, whom Ruskin later married. It was published in book form in 1851, and became an early Victorian classic which sold out three editions. In the \"Advertisement to the First Edition,\" which prefaces it, it is called a fairy tale, one, it might be added, that illustrates the triumph of love, kindness, and goodness over evil; however, it could also be characterized as a fable, a fabricated aetiological myth or etiology, and a parable. It was illustrated with 22 illustrations by Richard Doyle.'),('/m/075z4xp','Strayed Sheep (Our English Coasts) (1852) is a painting by British artist William Holman Hunt.'),('/m/075z4z2','May Morning on Magdalen Tower (1891) is a painting by British artist William Holman Hunt.'),('/m/075z4_t','Bianca (1868-1869) is a painting by British artist William Holman Hunt.'),('/m/07k8p9q','Bocca Baciata is a painting by Dante Gabriel Rossetti which represents a turning point in his career. It was the first of his pictures of single female figures, and established the style that was later to become a signature of his work. The model was Fanny Cornforth, the principal inspiration for Rossetti\'s sensuous figures.\nThe title, meaning \"mouth that has been kissed\", refers to the sexual experience of the subject and is taken from the Italian proverb written on the back of the painting:\nBocca baciata non perde ventura, anzi rinnova come fa la luna.\n‘The mouth that has been kissed does not lose its savour,\nindeed it renews itself just as the moon does.’\nRossetti, an accomplished translator of early Italian literature, probably knew the proverb from Boccaccio’s Decameron where it is used as the culmination of the tale of Alatiel: a beautiful Saracen princess who, despite having had sex on perhaps ten thousand occasions with eight separate lovers in the space of four years, successfully presents herself to the King of the Algarve as his virgin bride.\nRossetti explained in a letter to William Bell Scott that he was attempting to paint flesh more fully, and to \"avoid what I know to be a besetting fault of mine - & indeed rather common to PR painting - that of stipple in the flesh...Even among the old good painters, their portraits and simpler pictures are almost always their masterpieces for colour and execution; and I fancy if one kept this in view, one might have a better chance of learning to paint at last.\"'),('/m/08304','William Morris was an English textile designer, poet, novelist, translator, and revolutionary socialist. As a designer, he was associated with the English Arts and Crafts Movement and was a major contributor to the revival of traditional textile arts and methods of production in Britain. His literary contributions helped to establish the modern fantasy genre.\nBorn in Walthamstow, Essex to a wealthy middle-class family, Morris came under the strong influence of medievalism while studying Classics at Oxford University, there joining the Birmingham Set. After university he trained as an architect, married Jane Burden, and developed close friendships with the Pre-Raphaelite artists Edward Burne-Jones and Dante Gabriel Rossetti and with the Neo-Gothic architect Philip Webb. Webb and Morris designed a family home, Red House in Kent, where the latter lived from 1859 to 1865, before relocating to Bloomsbury, central London. In 1861, Morris founded a decorative arts firm with Burne-Jones, Rossetti, Webb, and others: the Morris, Marshall, Faulkner & Co.'),('/m/08fc1w','The Portrait of a Young Woman is a painting by the Italian High Renaissance master Raphael, made between 1518 and 1520. It is in the Galleria Nazionale d\'Arte Antica in Palazzo Barberini, Rome.\nIt is probable that the picture was in the painter\'s studio at his death in 1520, and that it was modified and then sold by his assistant Giulio Romano. In the 16th century the picture was in the house of the Countess of Santafiora, a Roman noblewoman, and subsequently became property of the Duke Boncompagni and then of the Galleria Nazionale which still possesses it.\nThe woman is traditionally identified with the fornarina Margherita Luti, Raphael\'s Roman lover, though this has been questioned. The woman is pictured with an oriental style hat and bare breasts. She is making the gesture to cover her left breast, or to turn it with her hand, and is illuminated by a strong light coming from outside. Her left arm has a narrow band carrying the signature of the artist, RAPHAEL URBINAS. It has been suggested that the right hand on the left breast reveals a cancerous breast tumour disguised in a classic pose of love.'),('/m/08myfl','The Young Man with an Apple is a painting by the Italian High Renaissance painter Raphael. It is housed in the Uffizi Gallery in Florence. Made during the artist\'s Florentine period, it is often thought to be the portrait of Francesco Maria I Della Rovere.'),('/m/08myw4','St. Michael is an oil painting by Italian artist Raphael. Also called the Little St. Michael to distinguish it from a larger, later treatment of the same theme, St. Michael Vanquishing Satan, it is housed in the Louvre in Paris. The work depicts the Archangel Michael in combat with the demons of Hell, while the damned suffer behind him. Along with St. George, it represents the first of Raphael\'s works on martial subjects.'),('/m/08n3y8','The St. Cecilia Altarpiece is an oil painting by Italian High Renaissance painter Raphael. Completed in his later years, around 1516-1517, the painting depicts Saint Cecilia, the patron saint of musicians and Church music, listening to a choir of angels in the company of St. Paul, St. John the Evangelist, St. Augustine and Mary Magdalene. Commissioned for a church in Bologna, the painting now hangs there in the Pinacoteca Nazionale, or National Painting Gallery. According to Vasari the musical instruments strewn about Cecilia\'s feet were not painted by Raphael, but by his student, Giovanni da Udine.\nIn 1880, English Romantic poet Percy Shelley described the painting as follows:\nThe central figure, St. Cecilia, seems rapt in such inspiration as produced her image in the painter\'s mind; her deep, dark, eloquent eyes lifted up; her chestnut hair flung back from her forehead — she holds an organ in her hands — her countenance, as it were, calmed by the depth of its passion and rapture, and penetrated throughout with the warm and radiant light of life. She is listening to the music of heaven, and, as I imagine, has just ceased to sing, for the four figures that surround her evidently point, by their attitudes, towards her; particularly St. John, who, with a tender yet impassioned gesture, bends his countenance towards her, languid with the depth of emotion. At her feet lie various instruments of music, broken and unstrung.'),('/m/08nczz','The Madonna and Child with an Angel is a painting by the Italian Renaissance painter Sandro Botticelli, c. 1465-1467. It is housed in Spedale degli Innocenti of Florence.\nThe painting, one of Botticelli\'s earliest, reveals Botticelli\'s close artistic relationship with his teacher, Filippo Lippi, and is modelled on the latter\'s The Virgin and Child with Two Angels.'),('/m/08nyct','The Tempi Madonna is an oil painting by the Italian High Renaissance painter Raphael. Painted for the Tempi family, it was bought by Ludwig I of Bavaria in 1829. It is housed in the Alte Pinakothek in Munich. It is thought to have been made in 1508, at the end of the artist\'s Florentine period.'),('/m/08pcjm','Portrait of a Man with a Medal of Cosimo the Elder, also known as Portrait of a Youth with a Medal, is a tempera painting by Italian Renaissance painter Sandro Botticelli. The painting features a young man displaying in triangled hands a medal stamped with the likeness of Cosimo de\' Medici. The identity of the young man has been a long-enduring mystery. Completed in approximately 1475, it is on display in the Uffizi Gallery of Florence.'),('/m/08pkk1','Portrait of a Young Man is a painting by the Italian Renaissance artist Sandro Botticelli, circa 1483. It is housed in the National Gallery of London.\nThis was originally attributed to Giorgione, Filippino Lippi or Masaccio and is the only known en face portrait by Botticelli.'),('/m/08pkmy','The Annunciation, also known as the Cestello Annunciation, is a tempera painting by the Italian Renaissance master Sandro Botticelli, circa 1489-1490. It is housed in the Uffizi Gallery of Florence.\nThe picture was commissioned in 1489 by the church of the Florentine convent of Cestello which is now known as Santa Maria Maddalena de\'Pazzi.\nUnderneath the painting on its original frame are words in Latin from St. Luke\'s Gospel 1:35 \"The Holy Ghost shall come upon thee, and the power of the Highest shall overshadow thee.\"'),('/m/08pvk5','The Canigiani Holy Family or Canigiani Madonna is a painting by the Italian High Renaissance artist Raphael. It is in the Alte Pinakothek of Munich, Germany.'),('/m/08pxxr','The Marriage of the Virgin, also known as Lo Sposalizio, is an oil painting by Italian High Renaissance artist Raphael. Completed in 1504 for a Franciscan church in Città di Castello, the painting depicts a marriage ceremony between Mary and Joseph. It changed hands several times before settling in 1806 at the Pinacoteca di Brera.'),('/m/08r46c','Christ Falling on the Way to Calvary, also known as Lo Spasimo or Il Spasimo di Sicilia, is a painting by the Italian High Renaissance painter Raphael, of circa 1514–16, now in the Museo del Prado in Madrid. It is an important work for the development of his style.'),('/m/08rz25','The Calumny of Apelles is a tempera painting by Italian Renaissance painter Sandro Botticelli. Based on the description of a painting by Apelles, the work was completed in approximately 1494. It is on display in the Uffizi in Florence.'),('/m/08yp69','The Madonna of Loreto is a painting finished around 1508-1509 by the Italian High Renaissance painter Raphael. It is housed in the Musée Condé of Chantilly, France.\nFor centuries the painting kept company with the Portrait of Pope Julius II, first at the Santa Maria del Popolo, then in private collections, and for a time their location was unknown. Their ownership, or provenance, has been difficult to unravel because of the number of copies of both paintings, the unclear ownership chain, misinformation and delay of publication of vital information.\nFor instance, this painting received its name from a copy at the Basilica della Santa Casa in Loreto which was at one time thought to be the original. Now is it certain that the painting at Loreto was a copy - and therefore the painting name is a misnomer.\nEven so, the well-copied painting has been a beloved and critically acclaimed painting for centuries.'),('/m/095l0','Bristol is a city, unitary authority area and ceremonial county in South West England, with an estimated population of 437,492 for the unitary authority in 2013, and a surrounding Larger Urban Zone with an estimated 1.07 million residents in 2007. It is England\'s sixth and the United Kingdom\'s eighth most populous city, one of the Core Cities Group and the most populous city in South West England.\nThe city received a Royal charter in 1155. It was part of Gloucestershire until 1373 when it became a county in its own right. From the 13th century, for half a millennium, it ranked among the top three English cities after London, alongside York and Norwich, on the basis of tax receipts, until the rapid rise of Liverpool, Birmingham and Manchester during the Industrial Revolution in the later 18th century. It borders the counties of Somerset and Gloucestershire, and is also located near the historic cities of Bath to the south east and Gloucester to the north. The city is built around the River Avon, and it also has a short coastline on the Severn Estuary, which flows into the Bristol Channel.\nBristol is the largest centre of culture, employment and education in the region.'),('/m/09cw9w','Fanny Cornforth was an English woman who became the artist\'s model and mistress of the Pre-Raphaelite painter Dante Gabriel Rossetti. Later, Cornforth performed the duties of housekeeper for Rossetti.\nWilliam Michael Rossetti, the artist\'s brother, wrote that \"she was a pre-eminently fine woman with regular and sweet features, and a mass of the most lovely blond hair – light-golden, or \'harvest yellow\'.\"\nIn Rossetti\'s paintings, the figures modeled by Fanny Cornforth are generally rather voluptuous, differing from those of other models such as Jane Morris and Elizabeth Siddal.'),('/m/0b34d','The United States presidential election of 1900 was the 29th quadrennial presidential election, held on Tuesday, November 6, 1900. The election was a re-match of the 1896 race between Republican candidate and incumbent President William McKinley and his Democratic challenger, William Jennings Bryan. The Republican Convention chose New York Governor Theodore Roosevelt as McKinley\'s running mate, since Vice-President Garret Hobart had died from heart failure in 1899. The return of economic prosperity and recent victory in the Spanish–American War for control of the Philippines helped McKinley to score a decisive victory, while Bryan\'s anti-imperialist stance and continued support for bimetallism attracted only limited support.'),('/m/0b6htgj','26 October 1993 is an artwork created in 1993 as a collaboration between English artists Henry Bond and Sam Taylor-Wood, both of whom were involved in the Young British Artists scene of contemporary art. It is a pastiche or remaking of a well-known photographic portrait of John Lennon and Yoko Ono that was made by Annie Leibovitz a few hours before Lennon\'s murder.'),('/m/0b9gtl','The Hireling Shepherd is a painting by the Pre-Raphaelite artist William Holman Hunt. It represents a shepherd neglecting his flock in favour of an attractive country girl to whom he shows a death\'s-head hawkmoth. The meaning of the image has been much debated.\nHunt painted the picture when he was working in close collaboration with John Everett Millais, who was painting Ophelia at the same time in the same region of Surrey. Both paintings depict English rural scenes, the innocence of which is disturbed by subtle but profoundly threatening violations of natural harmony. In Hunt\'s painting, the shepherd ignores his flock of sheep, who wander over a ditch into a field of corn. This violation of boundaries is paralleled by the shepherd\'s physical intrusions into the personal space of the young woman, who responds in an ambiguous way that might be interpreted as complicity or as a knowing scepticism. As he shows her the moth, he places his arm round her shoulder.'),('/m/0bc5t4','\"The Haystack in the Floods\" is a narrative poem of 160 lines by William Morris, the famous writer and designer, first published in The Defence of Guenevere, and Other Poems in 1858. It is probably his best-known poem. It is a grimly realistic piece set in France during the Hundred Years\' War. The doomed lovers Jehane and Robert de Morny flee with a small escort through a convincingly portrayed rain-swept countryside, to reach the safety of English-held Gascony. They are however intercepted by the treacherous Godmar and have a last despairing parting besides the \"old soaked hay\" of the title. The encounter takes place shortly after the Battle of Poitiers but the characters Godmar and Jehane are entirely fictional. Morris used the name of an English knight Sir Robert de Morny, who was born in Essex and fought at Poitiers but who did not die in the manner recited.'),('/m/0bxjtrx','The Virgin Adoring the Child (c. 1490) is a painting by Italian artist Sandro Botticelli.'),('/m/0c43g','Raffaello Sanzio da Urbino, better known simply as Raphael, was an Italian painter and architect of the High Renaissance. His work is admired for its clarity of form and ease of composition and for its visual achievement of the Neoplatonic ideal of human grandeur. Together with Michelangelo and Leonardo da Vinci, he forms the traditional trinity of great masters of that period.\nRaphael was enormously productive, running an unusually large workshop and, despite his death at 37, leaving a large body of work. Many of his works are found in the Vatican Palace, where the frescoed Raphael Rooms were the central, and the largest, work of his career. The best known work is The School of Athens in the Vatican Stanza della Segnatura. After his early years in Rome much of his work was executed by his workshop from his drawings, with considerable loss of quality. He was extremely influential in his lifetime, though outside Rome his work was mostly known from his collaborative printmaking.'),('/m/0c8q2_','The Portrait of a Young Woman, also known as La Muta, is a portrait by the Italian Renaissance artist Raphael, c. 1507-1508. It is housed in the Galleria Nazionale delle Marche, in Urbino.\nThe picture portrays an unknown noblewoman over a near-black background, showing some Leonardesque influences. Although only recently attributed to Raphael, it is ranked among the best portraits by his hand.\nThe neatness of the large areas of colour which emerge in lighter tones from the background, and the analytical treatment of the details of the woman\'s clothing are characteristic of Raphael. The dispersive effect of this attention to detail is fully compensated by the tones of colour - used here in a fairly limited range - which unify the composition as a whole.\nX-ray analysis have showed the presence of an early Raphael years drawing under the painting, showing a female, young face with soft features, with later modifications.'),('/m/0cblyt','Julian Opie is a visual artist, and one of the New British Sculpture movement.'),('/m/0chsj1','Madonna in Glory with Seraphim is a painting by the Italian Renaissance painter Sandro Botticelli, executed c. 1469-1470. It is housed in Galleria degli Uffizi of Florence.\nSome panel paintings of the Madonna by Botticelli remain from the years around 1470 which are striking expressions of Botticelli\'s stylistic development. Two full figure pictures of the Madonna - the Madonna in Glory and the Madonna of the Rosegarden - are in the Uffizi. They represent monumental seated figures filling the entire picture.\nMary is enthroned on clouds in a glory of seraphim. The Christ Child, with the cruciform nimbus, is looking towards the observer and raising his hand in blessing. Botticelli has succeeded in expressing the tensions in this theme with sensitivity: the mother, who is fully aware of the Passion her son will suffer, is holding him protectively in her arms.'),('/m/0cm2xh','World War I, also known as the First World War, was a global war centred in Europe that began on 28 July 1914 and lasted until 11 November 1918. From the time of its occurrence until the approach of World War II, it was called simply the World War or the Great War, and thereafter the First World War or World War I. In America, it was initially called the European War. More than 9 million combatants were killed; a casualty rate exacerbated by the belligerents\' technological and industrial sophistication, and tactical stalemate. It was one of the deadliest conflicts in history, paving the way for major political changes, including revolutions in many of the nations involved.\nThe war drew in all the world\'s economic great powers, which were assembled in two opposing alliances: the Allies and the Central Powers of Germany and Austria-Hungary. Although Italy had also been a member of the Triple Alliance alongside Germany and Austria-Hungary, it did not join the Central Powers, as Austria-Hungary had taken the offensive against the terms of the alliance.'),('/m/0cwt70','Campaignbox\nCaucasus\nPersia\nGallipoli\nMesopotamia\nSinai and Palestine\nArab Revolt\nSouth Arabia\nSouth-West Africa\nTogoland\nCameroon\nEast Africa\nNorth Africa\nU-boat\nAtlantic Ocean\nMediterranean\n\nAlthough considerable conflict took place outside Europe, the European theatre was the main theatre of operations during World War I and was where the war began and ended. During the four years of conflict, battle was joined by armies of unprecedented size equipped with new mechanized technologies, leaving millions dead or wounded.'),('/m/0d5sjb','The Light of the World is an allegorical painting by William Holman Hunt representing the figure of Jesus preparing to knock on an overgrown and long-unopened door, illustrating Revelation 3:20: \"Behold, I stand at the door and knock; if any man hear My voice, and open the door, I will come in to him, and will sup with him, and he with Me\". According to Hunt: \"I painted the picture with what I thought, unworthy though I was, to be by Divine command, and not simply as a good Subject.\" The door in the painting has no handle, and can therefore be opened only from the inside, representing \"the obstinately shut mind\". Hunt, 50 years after painting it, felt he had to explain the symbolism.\nThe original, painted at night in a makeshift hut at Worcester Park Farm in Surrey, is now in a side room off the large chapel at Keble College, Oxford. Toward the end of his life, Hunt painted a life-size version, which was hung in St Paul\'s Cathedral, London, after a world tour where the picture drew large crowds. Due to Hunt\'s increasing infirmity, he was assisted in the completion of this version by English painter Edward Robert Hughes.'),('/m/0dbwsn','My Bed is a work by the British artist Tracey Emin. First created in 1998, it was exhibited at the Tate Gallery in 1999 as one of the shortlisted works for the Turner Prize. It consisted of her bed with bedroom objects in an abject state, and gained much media attention. Although it did not win the prize, its notoriety has persisted.\nThe artwork generated considerable media furore, particularly over the fact that the bedsheets were stained with bodily secretions and the floor had items from the artist\'s room. The bed was presented in the state that Emin claimed it had been when she said she had not got up from it for several days due to suicidal depression brought on by relationship difficulties.\nTwo performance artists, Yuan Chai and Jian Jun Xi, jumped on the bed with bare torsos in order to improve the work, which they thought had not gone far enough. They called their performance Two Naked Men Jump into Tracey\'s Bed. The men also had a pillow fight on the bed for around fifteen minutes, to applause from the crowd, before being removed by security guards. The artists were detained but no further action was taken.'),('/m/0f96_c','The Well at the World\'s End is a fantasy novel by the British artist, poet, and author William Morris. It was first published in 1896 and has been reprinted a number of times since, most notably in two parts as the twentieth and twenty-first volumes of the Ballantine Adult Fantasy series in August and September 1970. It is also available in one volume along with a similar Morris tale, The Wood Beyond the World, in On the Lines of Morris\' Romances: Two Books that Inspired J. R. R. Tolkien.'),('/m/0gjd7w2','The Prophet Isaiah is a fresco located in Basilica di Sant\'Agostino, an early Renaissance church in Rome. It is an Italian Renaissance painting, influenced by Michaelangelo\'s work on the Sistine Chapel ceiling.\nIsaiah, a powerful figure, gives the illusion of a three-dimensional character, flanked by putti figures. He carries a Hebrew scroll with his prophecy foretelling the birth of Christ. There is also a message to Saint Anne. Due to wear, Raphael\'s work has been retouched by other painters over time. In 1960, the fresco was restored to Raphael\'s vision.'),('/m/0gmdgc3','The Temptations of Christ is a fresco by the Italian Renaissance painter Sandro Botticelli, executed in 1480–1482 and located in the Sistine Chapel, Rome.'),('/m/0gmg3yb','The Punishment of the Rebels is a fresco by the Italian Renaissance painter Sandro Botticelli, executed in 1480-1482 and located in the Sistine Chapel, Rome.'),('/m/0gv4w9','The Madonna and Child with Two Angels is a painting by the Italian Renaissance master Sandro Botticelli, dating to c. 1468-1469. It is housed in the Museo Nazionale di Capodimonte, in Naples.\nThis works was once attributed to Filippino Lippi, master of Botticelli. The typology of the faces and other details induce to date the work to the same period of the Fortitude and the other juvenile Madonnas of the Italian painter. The composition is similar to Verrocchio\'s Madonna of the Milk, dating from the late 1460s.'),('/m/0gv5kv','The Portrait of a Young Man is a painting by the Italian Renaissance artist Sandro Botticelli, dated between 1470 and 1475. It is housed in the Palazzo Pitti of Florence.\nVariously attributed to different painters, it was eventually included in Botticelli\'s works. It is one of the first known three-quarters portraits in western European art.'),('/m/0h65pvz','The Portrait of Emilia Pia da Montefeltro is a picture from around 1504-1505, attributed to the Italian Renaissance artist Raphael and housed by the Baltimore Museum of Art, United States'),('/m/0h68znm','The Portrait of Guidobaldo da Montefeltro is a picture by the Italian Renaissance artist Raphael, dating from around 1506 and housed in the Uffizi Gallery, Florence. It portrays Guidobaldo da Montefeltro, duke of Urbino.'),('/m/0hc9x6h','The Bodmer Oak—named after the Swiss artist Karl Bodmer (1809-1893), who exhibited his painting of the tree at the 1850 Salon—was one of several imposing trees in the Fontainebleau Forest that had acquired a special appellation.\nThe carpet of russet leaves signals that Monet painted this canvas just before he left Chailly-en-Bière, near Fontainebleau, in October 1865. It is probably the last of several landscapes executed in connection with his monumental \"Déjeuner sur l\'herbe\" (fragments of which are now at the Musée d\'Orsay, Paris). \nThe slash in the upper right-hand corner of the painting may have been made by Monet, who reputedly mutilated some canvases in order to discourage a landlord from seizing them in 1866.'),('/m/0hnc11l','The Madonna of the Candelabra is a Madonna painting by the Italian renaissance artist Raphael, dating to about 1513 and is in the collection of the Walters Art Museum in Baltimore.\nPainted during his Roman period, this tondo Madonna of the Virgin and Child employs a rare motif of flanking candelabra that was derived from representations of ancient Roman emperors. Through this reference to the rulers of antiquity, Raphael alludes to Christ\'s and Mary\'s roles as the king and queen of Heaven. Raphael was famed for his graceful style. which combined the study of classical sculpture and nature. The chiaroscuro effects and gentle coloring give the figures a soft, delicate appearance. The painting relies heavily on the participation of Raphael\'s workshop, and the two angels certainly were done by his assistants. This was the first Madonna painted by Raphael to enter a North American collection. It was purchased by Henry Walters in 1901.\nThe central portion of the painting was issued as the traditional holiday first class Christmas stamp for 2011 by the United States Postal Service. The stamp was released on October 13, 2011 in New York, New York.'),('/m/0hr16yq','Alexa Wilding was one of the favourite models of the Pre-Raphaelite artist Dante Gabriel Rossetti, featuring in some of his finest paintings of the later 1860s and early 1870s. She sat for more of his finished works than any other of his more well known muses, Elizabeth Siddall, Jane Morris and Fanny Cornforth.\nComparatively little is known about Rossetti\'s most used model, while Siddall, Morris and Cornforth are frequently written about. This is perhaps partly due to the lack of romantic or sexual connection that separates Rossetti\'s relationship with Wilding from his other muses.'),('/m/0j7ng','Newcastle upon Tyne, commonly known as Newcastle, and historically known as Newcastle-on-Tyne, is a city and metropolitan borough in Tyne and Wear, North East England, situated on the north bank of the River Tyne and centred 8.5 mi from the North Sea. It is the most populous city in North East England. The city lies at the urban core of the Tyneside conurbation, which is the seventh most populous conurbation in the United Kingdom and the most populous in the North East region. Newcastle is a member of the English Core Cities Group and with Gateshead the Eurocities network of European cities. Newcastle was part of the county of Northumberland until 1400 when it became a county of itself; a status it retained until becoming part of the Tyne and Wear metropolitan county in 1974.\nThe city grew up in the area that was the location of the Roman settlement called Pons Aelius, and it owes its name to the castle built in 1080, by Robert, Duke of Normandy, \"Curthose\", William the Conqueror\'s eldest son. The city grew as an important centre for the wool trade and it later became a major coal mining area.'),('/m/0jr3g','Alessandro di Mariano di Vanni Filipepi, better known as Sandro Botticelli, was an Italian painter of the Early Renaissance. He belonged to the Florentine School under the patronage of Lorenzo de\' Medici, a movement that Giorgio Vasari would characterize less than a hundred years later as a \"golden age\", a thought, suitably enough, he expressed at the head of his Vita of Botticelli. Botticelli\'s posthumous reputation suffered until the late 19th century; since then his work has been seen to represent the linear grace of Early Renaissance painting. Among his best known works are The Birth of Venus and Primavera.'),('/m/0k5mt','John Ruskin was the leading English art critic of the Victorian era, also an art patron, draughtsman, watercolourist, a prominent social thinker and philanthropist. He wrote on subjects ranging from geology to architecture, myth to ornithology, literature to education, and botany to political economy. His writing styles and literary forms were equally varied. Ruskin penned essays and treatises, poetry and lectures, travel guides and manuals, letters and even a fairy tale. The elaborate style that characterised his earliest writing on art was later superseded by a preference for plainer language designed to communicate his ideas more effectively. In all of his writing, he emphasised the connections between nature, art and society. He also made detailed sketches and paintings of rocks, plants, birds, landscapes, and architectural structures and ornamentation.\nHe was hugely influential in the latter half of the 19th century, and up to the First World War. After a period of relative decline, his reputation has steadily improved since the 1960s with the publication of numerous academic studies of his work.'),('/m/0lqfqvm','The Story of Nastagio Degli Onesti, part one is a painting in tempera on wood by Sandro Botticelli, dated 1483. It measures 83 x 138 cm and is held in the Prado in Madrid.'),('/m/0q0f4','Sir John Everett Millais, 1st Baronet, PRA was an English painter and illustrator who was one of the founders of the Pre-Raphaelite Brotherhood.\nA child prodigy, at the age of 11 he became the youngest student to enter the Royal Academy Schools. The Pre-Raphaelite Brotherhood was founded at his parents\' house in London. Millais became the most famous exponent of the style, his painting Christ in the House of his Parents generating considerable controversy. By the late 1850s Millais was moving away from the Pre-Raphaelite style. His later works were enormously successful, making Millais one of the wealthiest artists of his day. However, they have typically been viewed by 20th century critics as failures. This view has changed in recent decades, as his later works have come to be seen in the context of wider changes in the art world.\nMillais\' personal life has also played a significant role in his reputation. His wife Effie was formerly married to the critic John Ruskin, who had supported Millais\' early work. The annulment of the marriage and her marriage of Millais have sometimes been linked to his change of style.'),('/m/0vh96','William Holman Hunt OM was an English painter, and one of the founders of the Pre-Raphaelite Brotherhood.'),('/m/0xnq1l3','Verity is a stainless steel and bronze statue created by Damien Hirst. The 67-foot tall sculpture stands on the pier in Ilfracombe, Devon and looks out over the harbour. It has been loaned to the town for 20 years. The name of the piece refers to \"truth\" and Hirst describes his work as a \"modern allegory of truth and justice\".\nThe statue depicts a pregnant woman holding aloft a sword while carrying the scales of justice and standing on a pile of law books. Half of the sculpture shows the internal anatomy of the pregnant woman, with the unborn baby clearly visible. The stance has been described as a reference to Little Dancer of Fourteen Years by Edgar Degas, a work that previously inspired Hirst when he created Virgin Mother.\nThe sculpture was cast in stainless steel and bronze in 40 separate sections by Pangolin Editions. The sword, which gives the statue much of its height, and the upper left arm is one polymer-strengthened fibre glass piece. Before being cleared for erection the statue was subjected to tests in a wind tunnel to ensure that it could cope with high winds and spray from the sea.'),('/m/0_qg48g','Mickey is a household gloss on canvas painting by Damien Hirst executed in 2012. Hirst was invited by Disney to create an artwork inspired by Mickey Mouse and this was his response. The work was auctioned at Christie\'s, London, on 13 February 2014 in aid of Kids Company, a charity Hirst has long supported, fetching £902,500.\nThe auction lot notes quote Hirst as commenting:\nThe thing about Mickey is that even though he’s gone through so many shifts in form and association, he’s timeless. In a way he means the same in the 21st century as he did decades ago. I watched the cartoons as a kid, and my kids watch them too. He’s relevant because he’s remained so culturally ingrained and he still just looks so great. The way children are entertained today has obviously changed dramatically, but kids are still kids, and love the same things.\n\nIt’s using simple means to capture the very essence of his form solely through the power of colour. I love that the imagery is so powerful that it only takes twelve different coloured dots to create something so instantly recognisable.'),('/m/0_w3mn5','The painting was formerly attributed to Raffaello Sanzio.');
